import React from "react";
import { Link } from "react-router-dom";

const NavLinkComponent = (props) => {
  return (
    <div className="nav-link-component">
      <Link to={`${props.path}`}>
        <li className="nav-item">
          <span className="nav-link" href="#">
            {props.name}
          </span>
        </li>
      </Link>
    </div>
  );
};

export default NavLinkComponent;
